                <table class="ui inverted red table">
                <thead>
                    <tr>
                        <th align="left">Food</th>
                        <th align="left">Calories</th>
                        <th align="left">Protein</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td align="left">{name}</td>
                        <td align="left">{category}</td>
                        <td align="left">0g</td>
                    </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}
